package com.team.app.store.vo;

public class StoreReviewVO {
	private int pro_reply_no;
	private String user_id;
	private int product_no;
	private int product_star;
	private String pro_reply_content;
	private String pro_reply_date;
	
	public StoreReviewVO() {
		// TODO Auto-generated constructor stub
	}

	public int getPro_reply_no() {
		return pro_reply_no;
	}

	public void setPro_reply_no(int pro_reply_no) {
		this.pro_reply_no = pro_reply_no;
	}

	public String getUser_id() {
		return user_id;
	}

	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}

	public int getProduct_no() {
		return product_no;
	}

	public void setProduct_no(int product_no) {
		this.product_no = product_no;
	}

	public int getProduct_star() {
		return product_star;
	}

	public void setProduct_star(int product_star) {
		this.product_star = product_star;
	}

	public String getPro_reply_content() {
		return pro_reply_content;
	}

	public void setPro_reply_content(String pro_reply_content) {
		this.pro_reply_content = pro_reply_content;
	}

	public String getPro_reply_date() {
		return pro_reply_date;
	}

	public void setPro_reply_date(String pro_reply_date) {
		this.pro_reply_date = pro_reply_date;
	}
	
	
	
}
